(1, '1.png', 1, 'Bulbasaur', 'Grass', 'Poison', 'For some time after its birth, it grows by gaining nourishment from the seed on its back.', '0.7', '6.9', 102, NULL, 17, 45, 49, 49, 65, 65, 45, 318),
